import React from 'react';

const PortfolioItem = (props) => {
    return (
        <div className="col-12 col-sm-6 col-md-4 port-container">
          <a href={props.link}>
            <img src={props.img} alt="Digital Graphic" width="90%" />
            <div className="overlay green">
              <p className="text">
                Graphic Design
              </p>
            </div>
          </a>
        </div>
    )
}

export default PortfolioItem;
